import React from 'react';
import '../Pages/homepage.css';
import Navbar from '../components/navbar';
// import bg from '../images/bgsvg.svg';

function Homepage() {
    return (
        <div className="frontview">
            <div className="navbar" >
                <Navbar></Navbar>
            </div>
            <div className="middle">
                <p>Simple and Powerful</p>
                <h1>Website Screenshot API
                </h1>
                <p>based on <b>Google Chrome</b> and <b>AWS Lambda</b></p>

            </div>
        </div>
    );
}

export default Homepage;
